import React from "react";
import { Form } from "react-bootstrap";
import '../selectInput/selectInput.css'

export default function Select({register, rules, errors, required}) {
    
    return (
        <>
            <div className='form-floating'>
                <Form.Select className="selectInput" name='gender' aria-label="Default select example" id="gender" name="gender">
                    <option hidden selected></option>
                    <option value="1">Male</option>
                    <option value="2">Female</option>
                    {/* <option value="3">Three</option> */}
                </Form.Select>
                {errors['gender'] && errors['gender'].type === 'required' && <p className="validation-error">Required field</p>}
                <Form.Label htmlFor='gender'>Gender
                {required && <span className="reqStar">&nbsp;*</span>}
                </Form.Label>
            </div>
        </>
    )
}
